import React, { useState } from "react";
import "./index.css"

const App =()=>{
    let color = "green"
    const[newcolor,setColor]=useState(color)
    const run =()=>{
       let colors = "red"
        setColor("colors")
    }
    let newc ="orange"
    const[greet,setgreet] = useState(newc)
    const again =()=>{
        newc ="orange"
        setgreet(newc)
    }
    
    return(
        <div style={{backgroundColor:newcolor }}>
            <button onClick={run} onDoubleClick={again}>click Me!</button>
        </div>
    )
}

export default App
